/**
 * Supabase 配置工具 - 統一管理 Project ID 和相關 URL
 * 提供前端和後端統一的配置管理方式
 */

// Supabase 專案配置
export const SUPABASE_CONFIG = {
  PROJECT_ID: 'ocyqhxgteydyuyzywbup',

  // 動態生成的 URL
  get URL() {
    return `https://${this.PROJECT_ID}.supabase.co`;
  },

  get AUTH_URL() {
    return `${this.URL}/auth/v1`;
  },

  get JWK_URL() {
    return `${this.AUTH_URL}/keys`;
  },

  // API Keys
  ANON_KEY: 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6Im9jeXFoeGd0ZXlkeXV5enl3YnVwIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NDkwMjYwMDgsImV4cCI6MjA2NDYwMjAwOH0.Ca019tua_JQVhxQn7FkJSYrzuzytMLp2HD4CmZqynoE',

  // 配置驗證
  validate() {
    const errors = [];

    if (!this.PROJECT_ID) {
      errors.push('SUPABASE_PROJECT_ID is required');
    }

    if (!this.ANON_KEY) {
      errors.push('SUPABASE_ANON_KEY is required');
    }

    if (this.PROJECT_ID && !this.PROJECT_ID.match(/^[a-z0-9]{20}$/)) {
      errors.push('SUPABASE_PROJECT_ID format is invalid (should be 20 lowercase alphanumeric characters)');
    }

    return {
      isValid: errors.length === 0,
      errors
    };
  }
};

// 導出配置驗證函數
export function validateSupabaseConfig() {
  const validation = SUPABASE_CONFIG.validate();

  if (!validation.isValid) {
    console.error('Supabase configuration errors:', validation.errors);
    throw new Error(`Supabase configuration is invalid: ${validation.errors.join(', ')}`);
  }

  return true;
}

// 便利函數
export function getSupabaseUrl() {
  return SUPABASE_CONFIG.URL;
}

export function getSupabaseAuthUrl() {
  return SUPABASE_CONFIG.AUTH_URL;
}

export function getSupabaseJwkUrl() {
  return SUPABASE_CONFIG.JWK_URL;
}

// 開發環境配置資訊
export function getConfigInfo() {
  return {
    projectId: SUPABASE_CONFIG.PROJECT_ID,
    url: SUPABASE_CONFIG.URL,
    authUrl: SUPABASE_CONFIG.AUTH_URL,
    jwkUrl: SUPABASE_CONFIG.JWK_URL,
    hasAnonKey: !!SUPABASE_CONFIG.ANON_KEY,
    validation: SUPABASE_CONFIG.validate()
  };
}

import requests
from functools import wraps
from flask import request, jsonify, g
import logging
import sys
import os
import time
from jose import jwt, jwk
from jose.exceptions import JWTError

# 添加專案根目錄到 Python 路徑
sys.path.append(os.path.dirname(os.path.dirname(os.path.dirname(__file__))))
from config import get_config

logger = logging.getLogger(__name__)
config = get_config()

class AuthService:
    """驗證服務類別"""

    def __init__(self):
        self.config = config
        # JWK 快取
        self._jwks_cache = None
        self._jwks_cache_time = 0
        self._jwks_cache_ttl = 600  # 10 分鐘快取期限

    def get_jwks(self):
        """取得 JWK 公鑰集合 (含快取機制)"""
        current_time = time.time()

        # 檢查快取是否有效
        if (self._jwks_cache is None or 
            current_time - self._jwks_cache_time > self._jwks_cache_ttl):

            try:
                logger.info(f"Fetching JWK from: {self.config.SUPABASE_JWK_URL}")
                response = requests.get(
                    self.config.SUPABASE_JWK_URL,
                    timeout=self.config.AUTH_TIMEOUT
                )
                response.raise_for_status()

                self._jwks_cache = response.json()
                self._jwks_cache_time = current_time
                logger.info("JWK cache updated successfully")

            except Exception as e:
                logger.error(f"Failed to fetch JWK: {e}")
                if self._jwks_cache is None:
                    raise Exception("No JWK cache available and failed to fetch new keys")

        return self._jwks_cache

    def verify_supabase_jwt(self, token):
        """驗證 Supabase JWT Token (使用 JWK)"""
        try:
            # 取得 token header
            header = jwt.get_unverified_header(token)

            # 取得 JWK 集合
            jwks = self.get_jwks()

            # 找到對應的公鑰
            key = None
            for jwk_key in jwks.get("keys", []):
                if jwk_key.get("kid") == header.get("kid"):
                    key = jwk_key
                    break

            if not key:
                logger.warning(f"No JWK found for kid: {header.get('kid')}")
                return None

            # 驗證 JWT
            payload = jwt.decode(
                token,
                key,
                algorithms=[key.get("alg", "RS256")],
                issuer=self.config.SUPABASE_ISSUER,
                options={"verify_aud": False}  # Supabase JWT 通常不包含 audience
            )

            return {
                'user_id': payload.get('sub'),
                'email': payload.get('email'),
                'role': payload.get('role', 'user'),
                'auth_type': 'supabase_jwt',
                'exp': payload.get('exp'),
                'iat': payload.get('iat')
            }

        except JWTError as e:
            logger.warning(f"JWT verification failed: {e}")
            return None
        except Exception as e:
            logger.error(f"Unexpected error during JWT verification: {e}")
            return None

    def verify_simple_token(self, token):
        """驗證簡單 API Token (測試回退)"""
        if hasattr(self.config, 'API_TOKEN'):
            return token == self.config.API_TOKEN
        return False

    def verify_supabase_via_api(self, token):
        """透過 Supabase API 驗證 token (備用方案)"""
        try:
            if not self.config.SUPABASE_URL:
                return None

            headers = {
                "Authorization": f"Bearer {token}",
                "apikey": self.config.SUPABASE_ANON_KEY
            }

            response = requests.get(
                f"{self.config.SUPABASE_URL}/auth/v1/user",
                headers=headers,
                timeout=self.config.AUTH_TIMEOUT
            )

            if response.status_code == 200:
                user_data = response.json()
                return {
                    'user_id': user_data.get('id'),
                    'email': user_data.get('email'),
                    'role': user_data.get('user_metadata', {}).get('role', 'user'),
                    'auth_type': 'supabase_api'
                }
            return None
        except Exception as e:
            logger.error(f"Supabase API verification failed: {e}")
            return None

    def extract_token_from_request(self):
        """從請求中提取 token"""
        # 檢查 Authorization header (Bearer token)
        auth_header = request.headers.get('Authorization', '')
        if auth_header.startswith('Bearer '):
            return auth_header.replace('Bearer ', '')

        # 檢查 X-API-Token header (用於簡單驗證)
        api_token = request.headers.get('X-API-Token')
        if api_token:
            return api_token

        return None

    def authenticate_user(self, token):
        """驗證用戶並返回用戶資訊"""
        if not token:
            return None, "Missing authentication token"

        # 優先順序：Supabase JWT -> Supabase API -> Simple Token

        # 1. 如果有 Supabase 配置，優先使用 JWT 驗證
        if hasattr(self.config, 'USE_SUPABASE') and self.config.USE_SUPABASE:
            # JWT JWK 驗證
            user = self.verify_supabase_jwt(token)
            if user:
                logger.info(f"User authenticated via Supabase JWT: {user['email']}")
                return user, None

            # API 驗證 (備用)
            user = self.verify_supabase_via_api(token)
            if user:
                logger.info(f"User authenticated via Supabase API: {user['email']}")
                return user, None

        # 2. 簡單 token 驗證 (測試回退)
        if self.verify_simple_token(token):
            logger.info("User authenticated via simple token")
            return {
                'user_id': 'simple-user',
                'email': 'api-user@local',
                'role': 'user',
                'auth_type': 'simple_token'
            }, None

        return None, "Invalid authentication token"

    def is_public_endpoint(self, path):
        """檢查是否為公開端點"""
        return any(path.startswith(endpoint) for endpoint in self.config.PUBLIC_ENDPOINTS)

    def is_protected_endpoint(self, path):
        """檢查是否為受保護端點"""
        # 所有非公開端點都被視為受保護端點
        return not self.is_public_endpoint(path)

# 全域驗證服務實例
auth_service = AuthService()

def require_auth(f):
    """裝飾器：要求驗證"""
    @wraps(f)
    def decorated_function(*args, **kwargs):
        # 檢查是否需要驗證
        if not config.REQUIRE_AUTH:
            # 開發模式不需要驗證時，設定預設用戶
            g.current_user = {
                'user_id': 'dev-user',
                'email': 'dev@local',
                'role': 'admin',
                'auth_type': 'development'
            }
            return f(*args, **kwargs)

        # 檢查是否為公開端點
        if auth_service.is_public_endpoint(request.path):
            return f(*args, **kwargs)

        # 提取並驗證 token
        token = auth_service.extract_token_from_request()
        user, error = auth_service.authenticate_user(token)

        if error:
            logger.warning(f"Authentication failed for {request.path}: {error}")
            return jsonify({'error': error}), 401

        # 將用戶資訊存入 g 物件
        g.current_user = user
        logger.info(f"Request authenticated: {user['email']} -> {request.path}")
        return f(*args, **kwargs)

    return decorated_function

def get_current_user():
    """取得當前用戶資訊"""
    return getattr(g, 'current_user', None)

